using Microsoft.Azure.CognitiveServices.Vision.ComputerVision;
using Microsoft.Azure.CognitiveServices.Vision.ComputerVision.Models;

namespace ComputerVisionQuickstart
{
    class Program
    {
        // Add your Computer Vision key and endpoint
        static string key =  Environment.GetEnvironmentVariable("VISION_KEY");
        static string endpoint = Environment.GetEnvironmentVariable("VISION_ENDPOINT");

        private const string READ_TEXT_URL_IMAGE = "https://i.ibb.co/25r6f8r/5f06950f-4f39-4cd7-8865-f038fde225bc.jpg";



        static void Main(string[] args)
        {
            Console.WriteLine("Azure Cognitive Services Computer Vision - .NET quickstart example");
            Console.WriteLine();

            ComputerVisionClient client = Authenticate(endpoint, key);

            // Extract text (OCR) from a URL image using the Read API
            //ReadFileUrl(client, READ_TEXT_URL_IMAGE).Wait();
            ReadImageBase64(client, "").Wait();
        }

        public static ComputerVisionClient Authenticate(string endpoint, string key)
        {
            ComputerVisionClient client =
              new ComputerVisionClient(new ApiKeyServiceClientCredentials(key))
              { Endpoint = endpoint };
            return client;
        }

        public static async Task ReadFileUrl(ComputerVisionClient client, string urlFile)
        {
            Console.WriteLine("----------------------------------------------------------");
            Console.WriteLine("READ FILE FROM URL");
            Console.WriteLine();

            // Read text from URL
            var textHeaders = await client.ReadAsync(urlFile);
            // After the request, get the operation location (operation ID)
            string operationLocation = textHeaders.OperationLocation;
            Thread.Sleep(2000);

            // Retrieve the URI where the extracted text will be stored from the Operation-Location header.
            // We only need the ID and not the full URL
            const int numberOfCharsInOperationId = 36;
            string operationId = operationLocation.Substring(operationLocation.Length - numberOfCharsInOperationId);

            // Extract the text
            ReadOperationResult results;
            Console.WriteLine($"Extracting text from URL file {Path.GetFileName(urlFile)}...");
            Console.WriteLine();
            do
            {
                results = await client.GetReadResultAsync(Guid.Parse(operationId));
            }
            while ((results.Status == OperationStatusCodes.Running ||
                results.Status == OperationStatusCodes.NotStarted));

            // Display the found text.
            Console.WriteLine();
            var textUrlFileResults = results.AnalyzeResult.ReadResults;
            foreach (ReadResult page in textUrlFileResults)
            {
                foreach (Line line in page.Lines)
                {
                    Console.WriteLine(line.Text);
                }
            }
            Console.WriteLine();
        }

        public static async Task ReadImageBase64(ComputerVisionClient client, string imageBase64)
        {
            Console.WriteLine("----------------------------------------------------------");
            Console.WriteLine("READ FILE FROM BASE64 STRING");
            Console.WriteLine();

            // Convert base64 to stream
            byte[] imageBytes = Convert.FromBase64String(imageBase64);
            using (var stream = new MemoryStream(imageBytes))
            {
                // Read text from stream
                var textHeaders = await client.ReadInStreamAsync(stream);
                // After the request, get the operation location (operation ID)
                string operationLocation = textHeaders.OperationLocation;
                Thread.Sleep(2000);

                // Retrieve the URI where the extracted text will be stored from the Operation-Location header.
                // We only need the ID and not the full URL
                const int numberOfCharsInOperationId = 36;
                string operationId = operationLocation.Substring(operationLocation.Length - numberOfCharsInOperationId);

                // Extract the text
                ReadOperationResult results;
                Console.WriteLine("Extracting text from base64 image...");
                Console.WriteLine();
                do
                {
                    results = await client.GetReadResultAsync(Guid.Parse(operationId));
                }
                while ((results.Status == OperationStatusCodes.Running ||
                    results.Status == OperationStatusCodes.NotStarted));

                // Display the found text.
                Console.WriteLine();
                var textUrlFileResults = results.AnalyzeResult.ReadResults;
                //foreach (ReadResult page in textUrlFileResults)
                //{
                //    foreach (Line line in page.Lines)
                //    {
                //        Console.WriteLine(line.Text);
                //    }
                //}

                foreach (ReadResult page in textUrlFileResults)
                {
                    foreach (Line line in page.Lines)
                    {
                        if (line.Text.Contains("$/"))
                        {
                            var parts = line.Text.Split(new string[] { "$/" }, StringSplitOptions.None);
                            if (parts.Length > 1)
                            {
                                string operationAmount = parts[1].Trim();
                                Console.WriteLine($"Importe: {operationAmount}");
                            }
                        }

                        // Verifica si la línea contiene el texto "Nºdeoperación:"
                        if (line.Text.Contains("Nº de operación:"))
                        {
                            // Extrae el número que sigue después de "Nºdeoperación:"
                            // Asumiendo que el formato es siempre "Nº de operación: [número]"
                            var parts = line.Text.Split(new string[] { "Nº de operación:" }, StringSplitOptions.None);
                            if (parts.Length > 1)
                            {
                                // Elimina espacios en blanco y muestra el número
                                string operationNumber = parts[1].Trim();
                                Console.WriteLine($"Número de operación encontrado: {operationNumber}");
                            }
                        }
                    }
                }

                Console.WriteLine();
            }
        }

    }
}